import HomeItems from "./HomeItems";
import classes from "./HomeSection1.module.css";

const HomeSection1 = (props) => {
  return (
    <div className={classes.container}>
        <div className={classes.item} id="item1">item 1</div>
        <div className={classes.item} id="item2">item 2</div>
        <div className={classes.item} id="item3">item 3</div>
    </div>
  );
};

export default HomeSection1;
